import './style.css';
import Article from './Components/Article';
import Btn from './Components/Btn';
import ActiveArticle from './Components/ActiveArticle';
import BtnActive from './Components/BtnActive';
import Articles from './Components/Articles';


class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      items: [
        {
          id: 1,
          title: 'flowers',
          img: 'img/flowers-item-1.jpg',
          desc: 'text',
          level: 'normal',
        },
        {
          id: 2,
          title: 'flowers2',
          img: 'img/flowers-item-1.jpg',
          desc: 'text2',
          level: 'easy',
        }
      ]
    }
  }
  render() {
    return (
        <div className="App">


          <Articles items={this.state.items}/>
          </div>
      );
    }
}
export default App;
